INSERT INTO `aboutmes` (`id`, `your_name`, `details`, `homeimage`, `aboutppageimage`, `storyimage`, `coverimage`, `photo`, `mylogo`, `title`, `status`, `contact`, `email`, `created_at`, `updated_at`) VALUES
(1, 'Badal Chandra Sarker, EFIAP & ABPS', '<h1 style=\"padding: 0px; margin: 0px 0px 10px; font-family: &quot;Source Sans Pro&quot;, Helvetica, Arial, Verdana, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><span style=\"text-align: justify; font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 1rem;\"><b style=\"\"><font color=\"#636363\">Badal Chandra Sarker, EFIAP &amp; ABPS</font></b></span></h1><p style=\"padding: 0px; margin: 0px 0px 10px; font-family: &quot;Source Sans Pro&quot;, Helvetica, Arial, Verdana, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><span style=\"color: rgb(255, 255, 255); text-align: justify; font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 1rem;\">Badal Sarkar is a professional photographer based in Bangladesh. He passionately captures his home country\'s beauty through stunning images of bustling cities and tranquil rural villages. His unique vision and creative eye highlight the many facets of Bangladesh, creating striking compositions that captivate and inspire. Whether shooting street scenes or portraiture, Badal\'s photographs resonate deeply, showcasing the best of the land. Recognized as one of the leading travel and documentary photographers in Bangladesh, his work truly speaks to the soul.</span><br></p><p class=\"MsoNormal\" style=\"text-align:justify\"><font color=\"#ffffff\"><span style=\"font-size: 1rem; font-family: &quot;Source Sans Pro&quot;, Helvetica, Arial, Verdana, sans-serif; text-align: start; padding: 0px; margin: 0px; font-weight: 700;\">Photographic Background</span><span style=\"font-size: 1rem; font-family: &quot;Source Sans Pro&quot;, Helvetica, Arial, Verdana, sans-serif; text-align: start;\">:</span><br></font></p><p class=\"MsoNormal\" style=\"text-align:justify\"><font color=\"#ffffff\"><span style=\"font-family: &quot;Source Sans Pro&quot;, Helvetica, Arial, Verdana, sans-serif; text-align: start;\"></span></font></p><p style=\"padding: 0px; margin: 0px 0px 10px; font-family: &quot;Source Sans Pro&quot;, Helvetica, Arial, Verdana, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><font color=\"#ffffff\">Basic Course on Photography from the Alias Francis in Dhaka.<br style=\"padding: 0px; margin: 0px;\">12 workshops on photographic different parts.</font></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; font-family: &quot;Source Sans Pro&quot;, Helvetica, Arial, Verdana, sans-serif;\"><font color=\"#ffffff\"><span style=\"font-weight: 700; padding: 0px; margin: 0px;\">Executive:</span><br style=\"padding: 0px; margin: 0px;\">International Affairs Secretary of Bangladesh Photography Society (BPS).</font></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; font-family: &quot;Source Sans Pro&quot;, Helvetica, Arial, Verdana, sans-serif;\"><font color=\"#ffffff\"><span style=\"font-weight: 700; padding: 0px; margin: 0px;\">Member:</span><br style=\"padding: 0px; margin: 0px;\">Life Member of Bangladesh Photographic Society (BPS)</font></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; font-family: &quot;Source Sans Pro&quot;, Helvetica, Arial, Verdana, sans-serif;\"><font color=\"#ffffff\">Life Member of The International Federation of Photographic Art (FIAP)</font></p><p style=\"padding: 0px; margin: 0px 0px 10px; font-family: &quot;Source Sans Pro&quot;, Helvetica, Arial, Verdana, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><font color=\"#ffffff\"><strong style=\"padding: 0px; margin: 0px; font-weight: 700;\">Achievements:</strong><br style=\"padding: 0px; margin: 0px;\">My photographs were exhibited at various international photo exhibitions in Bangladesh, India, Japan, Europe, and the United States, among others.</font></p><p style=\"padding: 0px; margin: 0px 0px 10px; font-family: &quot;Source Sans Pro&quot;, Helvetica, Arial, Verdana, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><font color=\"#ffffff\">I have won more than 240 photographic awards from various clubs, and national, and international photo competitions.</font></p><p style=\"padding: 0px; margin: 0px 0px 10px; font-family: &quot;Source Sans Pro&quot;, Helvetica, Arial, Verdana, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><font color=\"#ffffff\"><strong style=\"padding: 0px; margin: 0px; font-weight: 700;\">Some of his Important Awards:</strong><br style=\"padding: 0px; margin: 0px;\">Gold Medal winner from the International Photographic Salon of Japan the “Asahi Shimbun” Photo Competition JAPAN 2018<br style=\"padding: 0px; margin: 0px;\">Gold Medal winner from the International Photographic Salon of Japan the “Asahi Shimbun” Photo Competition JAPAN 2019</font></p><p style=\"padding: 0px; margin: 0px 0px 10px; font-family: &quot;Source Sans Pro&quot;, Helvetica, Arial, Verdana, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><font color=\"#ffffff\">“ Best Photographer of The Year, Bangladesh-2022 ” ABP</font></p><p style=\"padding: 0px; margin: 0px; font-family: &quot;Source Sans Pro&quot;, Helvetica, Arial, Verdana, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><font color=\"#ffffff\"><strong style=\"padding: 0px; margin: 0px; font-weight: 700;\">Language :</strong><br style=\"padding: 0px; margin: 0px;\">Bangali, Hindi and English</font></p>', '1705390188.homeimage.png', '1705390188.aboutppageimage.png', '1707591281.storyimage.jpg', '1707591281.coverimage.jpg', NULL, NULL, 'Travel and documentary photographers in Bangladesh.', 1, NULL, NULL, NULL, '2024-04-17 23:53:12');
