INSERT INTO `stories` (`id`, `title`, `category_id`, `tages`, `details`, `status`, `image`, `created_at`, `updated_at`) VALUES
(1, 'BREEDING ECOLOGY OF THE LITTLE TERN', 9, 'BREEDING ECOLOGY OF THE LITTLE TERN, T', '<p></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\nmso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:150%;\r\nmso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"en-AE\" style=\"font-size:12.0pt;line-height:150%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span lang=\"en-AE\" style=\"font-size:12.0pt;\r\nline-height:150%\">Little Tern birds are migratory birds of Bangladesh. They\r\noften visit Bangladesh during the Winter season. Plenty of Foods are available\r\nin Bangladesh which help them during the breeding period. The little tern is a\r\ncommon resident as well as a winter visitor to Rajshahi, Bangladesh. It is a\r\nsmall, slender, and streamlined bird with a pair of narrow, sharp-pointed wings\r\nand a forked tail.&nbsp;</span><span style=\"font-size: 12pt; text-indent: -0.25in;\">These features adapt it well to a swift and graceful flight\r\nas well as plunge-diving for fish from a height above the water. The white\r\nbelly helps to reduce its conspicuousness to underwater prey when the bird is\r\nflying over the water foraging. It has been breeding on Rajshahi Island ‘s\r\ncoastal sandhills.</span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\nmso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:150%;\r\nmso-list:l0 level1 lfo1\"><span style=\"font-size: 12pt; text-indent: -0.25in;\"><br></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\nmso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:150%;\r\nmso-list:l0 level1 lfo1\"><img src=\"data:image/jpeg;base64,\" data-filename=\"BREEDING ECOLOGY OF THE LITTLE TERN_02.jpg\" style=\"width: 1000px;\"><span style=\"font-size: 12pt; text-indent: -0.25in;\"><br></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\nmso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:150%;\r\nmso-list:l0 level1 lfo1\"><span style=\"font-size: 12pt; text-indent: -0.25in;\"><br></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\nmso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:150%;\r\nmso-list:l0 level1 lfo1\"><span style=\"font-size: 12pt; text-indent: -0.25in;\"><br></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\nmso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:150%;\r\nmso-list:l0 level1 lfo1\"><img src=\"data:image/jpeg;base64,\" data-filename=\"BREEDING ECOLOGY OF THE LITTLE TERN_03.jpg\" style=\"width: 1000px;\"><span style=\"font-size: 12pt; text-indent: -0.25in;\"><br></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\nmso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:150%;\r\nmso-list:l0 level1 lfo1\"><br></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:\r\n150%;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"en-AE\" style=\"font-size:12.0pt;line-height:150%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"en-AE\" style=\"font-size:12.0pt;\r\nline-height:150%\">Courtship starts with an aerial display involving the male\r\ncalling and carrying fish to attract a mate.</span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:\r\n150%;mso-list:l0 level1 lfo1\"><span lang=\"en-AE\" style=\"font-size:12.0pt;\r\nline-height:150%\"><o:p><br></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:\r\n150%;mso-list:l0 level1 lfo1\"><img src=\"data:image/jpeg;base64,\" data-filename=\"BREEDING ECOLOGY OF THE LITTLE TERN_05.jpg\" style=\"width: 1000px;\"><span lang=\"en-AE\" style=\"font-size:12.0pt;\r\nline-height:150%\"><o:p><br></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:\r\n150%;mso-list:l0 level1 lfo1\"><span lang=\"en-AE\" style=\"font-size:12.0pt;\r\nline-height:150%\"><o:p><br></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:\r\n150%;mso-list:l0 level1 lfo1\"><img src=\"data:image/jpeg;base64,\" data-filename=\"BREEDING ECOLOGY OF THE LITTLE TERN_07.jpg\" style=\"width: 1000px;\"><span lang=\"en-AE\" style=\"font-size:12.0pt;\r\nline-height:150%\"><o:p><br></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\nmso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:150%;\r\nmso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"en-AE\" style=\"font-size:12.0pt;line-height:150%;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol\">·<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"en-AE\" style=\"font-size:12.0pt;\r\nline-height:150%\">A female will chase him up high before he descends and back\r\non the beach she may accept the fish offered. Once an offering has been\r\naccepted they will then mate. Their nests are shallow scrapes on sand where\r\nthey normally lay 2-3 eggs.</span></p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\nmso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:150%;\r\nmso-list:l0 level1 lfo1\"><span lang=\"en-AE\" style=\"font-size:12.0pt;\r\nline-height:150%\"><br></span></p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\nmso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:150%;\r\nmso-list:l0 level1 lfo1\"><img src=\"data:image/jpeg;base64,\" data-filename=\"BREEDING ECOLOGY OF THE LITTLE TERN_09.jpg\" style=\"width: 1000px;\"><span lang=\"en-AE\" style=\"font-size:12.0pt;\r\nline-height:150%\"><br></span></p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\nmso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:150%;\r\nmso-list:l0 level1 lfo1\"></p>', 1, '1713177467.jpg', '2024-04-15 17:37:47', '2024-04-15 17:42:38');
INSERT INTO `stories` (`id`, `title`, `category_id`, `tages`, `details`, `status`, `image`, `created_at`, `updated_at`) VALUES
(2, 'A pictorial tale of Charak puja', 9, 'Charak Puja; puja; nill puja; shiva & kali; kali puja; celebration; sankranti; chaitra sankranti;', '<p>Charak Puja is a significant festival that pays tribute to Shiva and Kali, embodying themes of rejuvenation, absolution, and agricultural wealth. This celebration takes place on Chaitra Sankranti, the final day (April 14) of the month of Chaitra. Interestingly enough, this event ushers in the Bengali New Year that follows right after.</p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"01.jpg\" style=\"width: 50%;\">&nbsp;&nbsp;<br></p><p>The week-long celebration from Gajan to Charak Puja begins in the last week of Choitro, the final month of the Bengali calendar, and continues until the end of the Bengali year.</p><p>&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"02.jpg\" style=\"font-size: 1rem; width: 25%;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"03.jpg\" style=\"width: 25%;\"><span style=\"font-size: 1rem;\">&nbsp;&nbsp;</span><img src=\"data:image/jpeg;base64,\" data-filename=\"04.jpg\" style=\"font-size: 1rem; width: 25%;\">&nbsp; </p><p>Face painting is a significant ritual for the devotees.&nbsp;<span style=\"font-size: 1rem;\">The festival of Gajan is observed to honor the divine union of Lord Shiva and Harakali, a manifestation of Goddess Parvati. Devotees, adorned in attire representing mythological figures, enact performances on public thoroughfares, thereby sharing their regional folklore.</span></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"05.jpg\" style=\"width: 25%;\">&nbsp; &nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"07.jpg\" style=\"width: 25%;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"08.jpg\" style=\"width: 25%;\">&nbsp;&nbsp;</p><p><span style=\"color: rgb(187, 187, 187); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 15px; background-color: rgb(24, 25, 27);\">The Charak festival celebrated in Kamalganj, Moulovibazer, involves a unique ritual where devotees dedicate themselves to the deity Shiva by suspending themselves from a tree. The underlying belief is that participating in this festival will usher in prosperity and eradicate any hardships or distress experienced in the past year.</span></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"10.jpg\" style=\"width: 50%;\">&nbsp;<span style=\"font-size: 1rem;\">Thanks for reading the story ...</span><span style=\"color: rgb(187, 187, 187); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 15px; background-color: rgb(24, 25, 27);\"><br></span></p><p dir=\"auto\"></p><p></p>', 1, '1713287148.jpg', '2024-04-16 23:56:50', '2024-04-17 00:13:13');
